import { basePath, apiVersion } from './config';

export function getPostApi(limit, page) {
    const url = `${basePath}/${apiVersion}/get-Post?limit=${limit}&page=${page}`;

    return fetch(url)
        .then(response => response.json())
        .then(result => result)
        .catch(err => err)
}
